    "2016-09-17T10:58:55.786944",nt"name": "chemspell-web-service-api",nt"isopen":
    false,nt"url": null,nt"notes": "<p>The ChemSpell Web Service API provides
    chemical name spell checking and chemical name synonym look-up. ChemSpell contains
    more than 1.3 million chemical names related to organic, inorganic, pharmaceutical,
    toxicological, and environmental health topics. ChemIDplus is the source for ChemSpell.
    When a chemical name is entered, ChemSpell returns a list of chemical synonyms if
    the spelling is correct. If the spelling is incorrect, it returns a list of suggestions
    for alternate spellings.</p>n",nt"license_title": "License Not Specified",nt"extras":
